(function($) {

var controller = new ScrollMagic.Controller();
var staticController = new ScrollMagic.Controller();
var mainAnimation = function(){

    $('.elements-in').each(function (index, elem) {
        new ScrollMagic.Scene({
          duration: 1,
          triggerElement: elem,
          //triggerHook: "onEnter"
          //offset: -($(elem).outerHeight()/3)
        }).on("progress", function(event){
          if( event.progress == 1 ){
            $(elem).addClass('active');
            $(elem).trigger('classChanged');
          }else{
            $(elem).removeClass('active');
            $(elem).trigger('classChanged');
          }
        }).addTo(controller);
    });

};

//on load show illustration

$(window).on('load', function(){
  mainAnimation();
});

$(window).on('resize',function(){
  controller = controller.destroy(true);
  controller = new ScrollMagic.Controller();
  mainAnimation();
});

})( jQuery );

(function($) {


  //disabling scrolling

  // left: 37, up: 38, right: 39, down: 40,
  // spacebar: 32, pageup: 33, pagedown: 34, end: 35, home: 36
  var keys = {37: 1, 38: 1, 39: 1, 40: 1, 32: 1};

  function preventDefault(e) {
    e = e || window.event;
    if (e.preventDefault)
        e.preventDefault();
    e.returnValue = false;
  }

  function preventDefaultForScrollKeys(e) {
      if (keys[e.keyCode]) {
          preventDefault(e);
          return false;
      }
  }

  //disable scroll
  function disableScroll() {
    if (window.addEventListener) // older FF
        window.addEventListener('DOMMouseScroll', preventDefault, false);
    window.onwheel = preventDefault; // modern standard
    window.onmousewheel = document.onmousewheel = preventDefault; // older browsers, IE
    window.ontouchmove  = preventDefault; // mobile
    document.onkeydown  = preventDefaultForScrollKeys;
  }

  //enable scroll
  function enableScroll() {
      if (window.removeEventListener)
          window.removeEventListener('DOMMouseScroll', preventDefault, false);
      window.onmousewheel = document.onmousewheel = null;
      window.onwheel = null;
      window.ontouchmove = null;
      document.onkeydown = null;
  }




  $window = $(window);

  //animating svgs

  var svgArray = [];

  $window.on('load', function(){

    $('.svg-icon').each(function(index){
      $target = $(this);
      var vivus = new Vivus($target[0], {duration: 250});
      svgArray.push(vivus);
      $target[0].setAttribute('data-item', index);
    });

    $('.elements-in').on('classChanged', function(){

      var $this = $(this);

      if( $this.hasClass('active') ){
        $this.find('.svg-icon').each(function(){
          //console.log()
          svgArray[$(this).attr('data-item')].play();
        })
      }else{
        $this.find('.svg-icon').each(function(){
          svgArray[$(this).attr('data-item')].play(-3);
        })
      }
    });

  });




  //scroller

  $(window).on('load', function(){

    $('.scroller').on('click', function(e){

      e.preventDefault();
      var scrollTo = $(this).attr('data-scrollto');

      $('nav, .menu-trigger').removeClass('active');
      enableScroll();

      $('html,body').animate({
        scrollTop: $(scrollTo).offset().top
      }, 750);

    });

    $(window).on('scroll resize', function(){
      if( $(window).scrollTop() > 0 ){
        $('nav').addClass('scrolled');
      }else{
        $('nav').removeClass('scrolled');
      }
      adjustNav();
    });

    adjustNav = function(){
      var scrollTop = $(window).scrollTop();

      var scrollersArray = $('.scroll-anchor');

      for( var i = 0; i<scrollersArray.length; i++ ){
        if( scrollTop > $(scrollersArray[i]).offset().top ){
          $('.scroller').removeClass('active');
          $($('.scroller')[i]).addClass('active');
         }
      }
    }
  });



  //owl carousel

  //var owl;

  $(window).on('load', function(){


  var initCarousel = function(){
    $('.owl-carousel').owlCarousel({
      nav : true,
      dots: false,
      items: 4,
      responsive:{
          0:{
              items:3
          },
          600:{
              items:3
          },
          1000:{
              items:4
          }
      }
    });
  }





  $('.project-element').on('click', function(){

    if( !$(this).find('.button').hasClass('no-lightbox') ){

      var gallery = $(this).find('.gallery li');
      var galleryLength = gallery.length;

      var galleryToAppend = '<div class="photos-wrapper owl-carousel owl-theme">';

      for( var i = 0; i<galleryLength; i++ ){
        if( i == 0 ){
          $('.project-lightbox .main-photo').css('background-image', 'url('+$(gallery[i]).attr('data-img-url')+')');
          galleryToAppend += '<div class="item photo active" data-img-url='+$(gallery[i]).attr('data-img-url')+' style="background-image: url('+$(gallery[i]).attr('data-img-thumbnail')+');"></div>';
        }else{
          galleryToAppend += '<div class="item photo" data-img-url='+$(gallery[i]).attr('data-img-url')+' style="background-image: url('+$(gallery[i]).attr('data-img-thumbnail')+');"></div>';
        }
      }

        galleryToAppend += '</div>';

      $('.project-lightbox .bottom-photos').append(galleryToAppend);

      initCarousel();


      $('.project-lightbox').addClass('active');

      disableScroll();

    }

  });


  //owl

  $(document).on('click', '.owl-item', function(){
    $('.owl-item .photo').removeClass('active');
    $(this).find('.photo').addClass('active');

    var imgUrl = $(this).find('.photo').attr('data-img-url');

    $('.project-lightbox .main-photo').css('background-image', 'url('+imgUrl+')');
  });





  $('.project-lightbox .close-icon').on('click', function(){
    $('.project-lightbox').removeClass('active');
    enableScroll();
    window.setTimeout(function(){
      $('.project-lightbox .bottom-photos').html('');
    }, 500)
  });


  });






//inputs

$(window).on('load', function(){


  $('.wpcf7-form-control-wrap input').each(function () {
      if ($(this).val().length > 0) {
          $(this).closest('.input-wrapper').addClass('dirty');
      }
  });

  $('.wpcf7-form-control-wrap input').on('change keyup', function () {
      if ($(this).val().length > 0) {
          $(this).closest('.input-wrapper').addClass('dirty');
      } else {
          $(this).closest('.input-wrapper').removeClass('dirty');
      }
  });


  $('.input-wrapper').each(function(){
    var helperText = $(this).find('.helper-text');
    helperText.appendTo($(this).find('.wpcf7-form-control-wrap'));
  });

  //responsive menu

  $('.menu-trigger').on('click', function(){
    if($(this).hasClass('active')){
      $(this).removeClass('active');
      $('nav').removeClass('active');
      enableScroll();
    }else{
      $(this).addClass('active');
      $('nav').addClass('active');
      disableScroll();
    }
  });

  //lang switch write cookie

  $('.lang a').on('click', function(){
    if( $(this).attr('data-lang').length > 0 ){
      document.cookie = "langselected="+$(this).attr('data-lang');
    }
  });

});






})( jQuery );
